import React, { useState, useEffect } from "react";
import { useStyles } from "./style";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";

const headData = [
  {
    name: "Ăn uống",
    id: "anUong",
  },
  {
    name: "Nhà hàng uy tín",
    id: "nhaHangUyTin",
  },
  {
    name: "Ưu đãi hot",
    id: "uuDaiHot",
  },
  {
    name: "Mới nhất",
    id: "moiNhat",
  },
  {
    name: "Tin tức",
    id: "tinTuc",
  },
  {
    name: "Video",
    id: "video",
  },
];

const MyTypography = (props) => {
  return (
    <Typography align="center" variant="h3" {...props}>
      {props.children}
    </Typography>
  );
};

const MyContainerGrid = (props) => {
  return (
    <Grid container alignItems="center" {...props}>
      {props.children}
    </Grid>
  );
};

const TopBar = () => {
  const classes = useStyles();

  const showHeadData = (headData) => {
    return headData.map((item) => {
      return (
        <MyTypography key={item.id} className={classes.headDataItems}>
          {item.name}
        </MyTypography>
      );
    });
  };

  return (
    <div className={classes.root}>
      <AppBar position="static" color="transparent">
        <Toolbar>
          <MyContainerGrid spacing={2}>
            {/* Logo */}
            <Grid item xs={1}>
              <MyTypography className={classes.logo}></MyTypography>
            </Grid>
            {/* Middle */}
            <MyContainerGrid justify="center" item xs={7}>
              {showHeadData(headData)}
            </MyContainerGrid>
            {/* Login/ Sign in */}
            <MyContainerGrid item xs={4} justify="flex-end">
              <MyContainerGrid className={classes.headDataItems} item xs={6}>
                <AccountCircleIcon className={classes.icon} />
                <MyTypography>Đăng Nhập</MyTypography>
              </MyContainerGrid>

              <MyContainerGrid className={classes.headDataItems} item xs={6}>
                <AccountCircleIcon className={classes.icon} />
                <MyTypography>Đăng Ký</MyTypography>
              </MyContainerGrid>
            </MyContainerGrid>
          </MyContainerGrid>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default TopBar;
